import AboutBox from "../components/AboutBox";
import Navbar from "../components/Navbar";
import {useContext} from "react";
import AuthContext from "../utils/AuthProvider";









export default function Home(){

    const{setAuth} = useContext(AuthContext);

    const handleClick = (e) => {
        e.preventDefault();
        console.log("Attempting to log out...");

        // List all keys to be removed
        ['token', 'editMode', 'noteContent', 'currentNoteId'].forEach(key => {
            console.log(`Removing ${key} from localStorage`);
            localStorage.removeItem(key);
        });

        //setAuth({}); // Assuming you have access to setAuth here
        console.log("All specified items should be removed now.");
    };

    return (
        <div className="Home">
            <Navbar></Navbar>
            <AboutBox ></AboutBox>
            <a href="#" onClick={handleClick} className="logout-link">LOGOUT</a>
        </div>
    )
}
